import { Link } from "react-router-dom";
import { Container, Form, Header } from "semantic-ui-react";

export function Home()
{
    return (
        <Container style={{ width: "100%", minHeight: "50vh", margin: 50, display: "flex", alignItems: "center", flexDirection: "column", fontSize: 30, justifyContent: "center" }}>
            <Header style={{ display: "inline", fontSize: 50 }} as="h1">VEdit</Header>
            <div style={{ display: "flex", flexDirection: "row" }}>
                <Link style={{ display: "inline", margin: 20 }} to={"/signup"}>Sign Up</Link>
                <Link style={{ display: "inline", margin: 20 }} to={"/login"}>Log In</Link>
            </div>
        </Container>
    )
}
